import React, { useState } from "react";
import HeaderText from "../HeaderText";
import P1 from "../../SourceFiles/Work/Photography/p1.jpg";
import P2 from "../../SourceFiles/Work/Photography/p2.jpg";
import P3 from "../../SourceFiles/Work/Photography/p3.jpg";
import P4 from "../../SourceFiles/Work/Photography/p4.jpg";
import P5 from "../../SourceFiles/Work/Photography/p5.jpg";
import P6 from "../../SourceFiles/Work/Photography/p6.jpg";
import P7 from "../../SourceFiles/Work/Photography/p7.jpg";
import P8 from "../../SourceFiles/Work/Photography/p8.jpg";
import P9 from "../../SourceFiles/Work/Photography/p9.jpg";
import P10 from "../../SourceFiles/Work/Photography/p10.jpg";
import FlexBox from "../FlexBox";
import Button from "../Button";

function OurLastestWork() {
  const [operation, setoperation] = useState(
    {
      name : 'Photography'
    }
  )

  const[Data, setData] = useState(
    {
      Photography : [
        {
          id: 1,
          img: P1,
          name : 'T',
        },
        {
          id: 2,
          img: P2,
          name : 'H',
        },
        {
          id: 3,
          img: P3,
          name : 'A',
        },
        {
          id: 2,
          img: P4,
          name : 'N',
        },
        {
          id: 2,
          img: P5,
          name : 'K',
        },
        {
          id: 2,
          img: P6,
          name : ' ',
        },
        {
          id: 2,
          img: P7,
          name : 'Y',
        },
        {
            id: 2,
            img: P8,
            name : 'O',
          },
          {
            id: 2,
            img: P9,
            name : 'U',
          },
          {
            id: 2,
            img: P10,
            name : ' ',
          },
      ],
    }
  )
  Data.map(it => {
    console.log(it);
  })

  const [Design, setDesign] = useState([
    {
      id: 1,
      img: P2,
      name : 'T',
    },
    {
      id: 2,
      img: P1,
      name : 'H',
    },
    {
      id: 3,
      img: P3,
      name : 'A',
    },
    {
      id: 2,
      img: P4,
      name : 'N',
    },
    {
      id: 2,
      img: P5,
      name : 'K',
    },
    {
      id: 2,
      img: P6,
      name : ' ',
    },
    {
      id: 2,
      img: P7,
      name : 'Y',
    },
    {
        id: 2,
        img: P8,
        name : 'O',
      },
      {
        id: 2,
        img: P9,
        name : 'U',
      },
      {
        id: 2,
        img: P10,
        name : ' ',
      },
  ]);


  const [Print, setPrint] = useState([
    {
      id: 1,
      img: P3,
      name : 'T',
    },
    {
      id: 2,
      img: P2,
      name : 'H',
    },
    {
      id: 3,
      img: P1,
      name : 'A',
    },
    {
      id: 2,
      img: P4,
      name : 'N',
    },
    {
      id: 2,
      img: P5,
      name : 'K',
    },
    {
      id: 2,
      img: P6,
      name : ' ',
    },
    {
      id: 2,
      img: P7,
      name : 'Y',
    },
    {
        id: 2,
        img: P8,
        name : 'O',
      },
      {
        id: 2,
        img: P9,
        name : 'U',
      },
      {
        id: 2,
        img: P10,
        name : ' ',
      },
  ]);

  const OperationPhoto = () => {
    setoperation({
      name : 'photography'
    })
  }

  const OperationDesign = () => {
    setoperation({
      name : 'design'
    })

  }

  const OperationPrint = () => {
    setoperation({
      name : 'print'
    })

    console.log(operation);
  }
  return (
    <section id="our-lastest-works">
      <div id="olw-container" className = 'container'>
        <HeaderText
          name="Our Lastest Works"
          text="Lorem ipsum dolor sit amet. Proin gravida nibh vel velit auctor
            aliquet"
        />
        <div id = 'olw-category' className = 'flex'>
            <div id = 'olw-category-button-group'>
                <button className = 'olw-category-button' onClick = {OperationPhoto}>Photography</button>
                <button className = 'olw-category-button' onClick = {OperationDesign}>Design</button>
                <button className = 'olw-category-button' onClick = {OperationPrint}>Print</button>
            </div>
        </div>
        <div id="olw-item" className = 'flex'>
          {/* {Data.map((item) => {
            return <FlexBox key={item.id} img={item.img} name = {item.name}/>;
          })} */}

        </div>
        <Button name = 'View more work'/>
      </div>
    </section>
  );
}

export default OurLastestWork;
